import { gql } from "@apollo/client";

export const VIDEO_STATUS_SUBSCRIPTION = gql`
  subscription VideoStatusChanged($lobbyId: ID!, $userId: ID!) {
    videoStatusChanged(lobbyId: $lobbyId, userId: $userId) {
      code
      success
      data {
        status
        currTime
      }
    }
  }
`;
